import React, { useEffect, useState } from 'react';
import './SimuladorVuelo.css';

const SimuladorVuelo = ({ vueloId, solicitudId }) => {
  const [progreso, setProgreso] = useState(0);
  const [duracionVuelo, setDuracionVuelo] = useState(null);
  const [distanciaKm, setDistanciaKm] = useState(null);
  const [velocidadKmH, setVelocidadKmH] = useState(null);
  const [finalizado, setFinalizado] = useState(false);
  const [fechaInicio, setFechaInicio] = useState(null);
  const [fechaLlegada, setFechaLlegada] = useState(null);
  const [vueloExistente, setVueloExistente] = useState(null);

  useEffect(() => {
    const fetchVuelo = async () => {
      try {
        const response = await fetch(`http://localhost:8081/api/vuelos/solicitud/${solicitudId}`);
        const data = await response.json();

        if (data.length > 0) {
          setVueloExistente(data[0]);
          setFechaInicio(new Date(data[0].fechaInicio));
        }
      } catch (error) {
        console.error('‚ùå Error al obtener vuelo:', error);
      }
    };

    fetchVuelo();
  }, [solicitudId]);

  useEffect(() => {
    if (!vueloExistente) return;

    const velocidad = Math.floor(Math.random() * (80 - 30 + 1)) + 30; // km/h
    const duracionMin = Math.floor(Math.random() * (3 - 2 + 1)) + 2; // minutos
    const distancia = (velocidad * (duracionMin / 60)).toFixed(2); // km

    setVelocidadKmH(velocidad);
    setDuracionVuelo(duracionMin);
    setDistanciaKm(distancia);

    const totalMs = duracionMin * 60 * 1000;
    const intervalo = 1000;
    const incremento = 100 / (totalMs / intervalo);

    const timer = setInterval(() => {
      setProgreso(prev => {
        const nuevo = prev + incremento;
        if (nuevo >= 100) {
          clearInterval(timer);
          setFinalizado(true);
          const fechaFin = new Date();
          setFechaLlegada(fechaFin);
          finalizarVuelo(vueloExistente.id, duracionMin, distancia, fechaInicio, fechaFin);
          return 100;
        }
        return nuevo;
      });
    }, intervalo);

    return () => clearInterval(timer);
  }, [vueloExistente]);

  const finalizarVuelo = async (vueloId, duracion, distancia, inicio, fin) => {
    try {
      await fetch(`http://localhost:8081/api/vuelos/${vueloId}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          fechaInicio: inicio.toISOString(),
          fechaFin: fin.toISOString(),
          duracionMinutos: duracion,
          distanciaKm: parseFloat(distancia),
          estadoEntrega: 'exitoso'
        })
      });

      await fetch(`http://localhost:8081/api/solicitudes/${solicitudId}/estado?nuevoEstado=completada`, {
        method: 'PATCH'
      });

      console.log('‚úÖ Vuelo finalizado y solicitud marcada como completada');
    } catch (error) {
      console.error('‚ùå Error al finalizar vuelo:', error);
    }
  };

  return (
    <div className="vuelo-container">
      <div className="vuelo-imagen">
        <span className="imagen-placeholder">[ Imagen del vuelo aqu√≠ ]</span>
      </div>

      <h2 className="vuelo-titulo">Vuelo de Solicitud #{solicitudId}</h2>
      <p className="vuelo-info">Velocidad: <strong>{velocidadKmH} km/h</strong></p>
      <p className="vuelo-info">Duraci√≥n estimada: <strong>{duracionVuelo} min</strong></p>
      <p className="vuelo-info">Distancia estimada: <strong>{distanciaKm} km</strong></p>

      <div className="progreso-barra">
        <div
          className="progreso-barra-lleno"
          style={{ width: `${progreso}%` }}
        />
      </div>

      <p className="vuelo-porcentaje">Progreso: {Math.floor(progreso)}%</p>

      {finalizado && (
        <div className="vuelo-completado">
          ‚úÖ Vuelo completado exitosamente<br />
          üìç Llegada: {fechaLlegada?.toLocaleTimeString()}<br />
          ‚è±Ô∏è Duraci√≥n: {duracionVuelo} min<br />
          üìè Distancia: {distanciaKm} km
        </div>
      )}
    </div>
  );
};

export default SimuladorVuelo;
